import React from 'react';
import { useWeather } from './WeatherContext';

const Five = () => {
  const { fiveDayForecast } = useWeather();

  return (
    <div className='p-4 m-4 bg-blue-300'>
      {fiveDayForecast && fiveDayForecast.length > 0 && (
        <>
          <h2>Five-Day Forecast</h2>
          {fiveDayForecast.map((day, index) => (
            <div key={index}>
              <h3>{day.dt_txt}</h3>
              <p>Temperature: {day.main.temp}째C</p>
              <p>Feels like: {day.main.feels_like}째C</p>
              <p>Minimum Temperature: {day.main.temp_min}째C</p>
              <p>Maximum Temperature: {day.main.temp_max}째C</p>
              <p>Pressure: {day.main.pressure} hPa</p>
              <p>Humidity: {day.main.humidity}%</p>
              <p>Weather: {day.weather[0].description}</p>
            </div>
          ))}
        </>
      )}
    </div>
  );
}

export default Five;
